import root from './header.module.scss';

const myList = [{ lol: 'home' }, 'Про мене', 'Сервіси', 'Портфоліо', 'Клнтакти'];

console.log(myList);

const Header = () => {
	return (
		<div className={root}>
			<div className="logotyp">
				Web Deweloper <span>Kondratiev</span>
			</div>
			<ul className="myList">
				{/* {myList.map((i) => {
					<li key={i}>{myList[0]}</li>;
				})} */}
			</ul>
		</div>
	);
};

export default Header;
